script: |
  super -f text -I q9197.spq | sort > q9197.out

inputs:
  - name: q9197.spq
    data: |
      SELECT DISTINCT - cor0.col1 / - cor0.col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q9197.out
    data: |
      1
      2
      3
